import React from 'react';
import Home from './Home.js';
import {Route, Switch,  BrowserRouter} from 'react-router-dom';
import Login from './Login.js';

class App extends Component {
    render() {
        return (
            <div className="App">
                <BrowserRouter>
                    <Switch>
                    <Route exact path="/Home" >
                        component={Home}
                    </Route>
                        <Route component={Login} />
                    </Switch>
                </BrowserRouter>
            </div>
        );
    }
};

export default App;
